import React, {useState} from 'react';
import ToDo from './Todo';

function TodoList(props) {
    const [todoList, setTodoList] = useState([]);

    return (

        <div>
        todo list 
        {todoList.map((todo) => (
            <ToDo
                todo = {todo}    
             />
        ))}</div>
    )
}

export default TodoList;
